import * as React from 'react';
import { Link } from "react-router-dom";

export default function App() {
  return (
    <div>
      <h1>Bookkeeper</h1>
      <nav
        style={{
          borderBottom: "solid 1px",
          paddingBottom: "1rem",
        }}
      >
        <Link to="/Contact">Contact</Link> |{" "}
        <Link to="/Project">Project</Link>
      </nav>
    </div>
  );
}
